s to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Ishara ya kuingiza haiwezi kuhamishwa. Kunaweza kuwa na shida na ishara ya kuingiza.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Ishara ya pato haiwezi kuhamishwa. Kunaweza kuwa na shida na ishara ya pato.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Ishara ya pato haiwezi kuhamishwa. Kunaweza kuwa na shida na ishara ya pato. Kumbuka: ada ya uhamishaji na toa rehani haziendani na Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Uuzaji huu hautafaulu kwa sababu ya harakati za bei. Jaribu kuongeza uvumilivu wako wa kuteleza. Kumbuka: ada ya uhamishaji na toa rehani haziendani na Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Ununuzi huu hautafanikiwa ama kwa sababu ya kusonga kwa bei au ada kwenye uhamishaji. Jaribu kuongeza uvumilivu wako wa kuteleza.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Mwisho wa shughuli","Transaction rejected":"Muamala umekataliwa","Transaction submitted":"Muamala umewasilishwa","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Jaribu kuongeza uvumilivu wako wa kuteleza.<0/>KUMBUKA: Ada ya uhamishaji na tokeni za kuweka upya hazioani na Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Hitilafu isiyotarajiwa. Haikuweza kukadiria gesi kwa ubadilishaji.","Unexpected issue with estimating the gas. Please try again.":"Suala lisilotarajiwa na kukadiria gesi. Tafadhali jaribu tena.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Angalia kwenye Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Onyo","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Muamala wako utarejeshwa ikiwa umesubiri kwa muda mrefu zaidi ya kipindi hiki.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Muamala wako utarejeshwa ikiwa bei itabadilika vibaya na zaidi ya asilimia hii.","minutes":"dakika","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",